ovider` imports `useState` from a custom module that returns `null` in some environments (e.g., SSR vs client, or a misconfigured alias), you get the same symptom.\n\n3. **Hook being called from a non-React context** (less likely here)  \n   Normally this yields Invalid hook call rather than a `null` error, so the primary issue is almost certainly the import/usage of `useState`.\n\nGiven the stack trace and location (`ThemeProvider` line ~25), the most probable direct cause is:\n\n> `ThemeProvider` is using `useState` via an object that is `null` (e.g., `React` or a custom wrapper), instead of importing `useState` directly from `'react'`.\n\nThis is happening at app startup (ThemeProvider is high in the tree, wrapped by `ErrorBoundary` and `App`), so it likely breaks the entire `/feedback` page for the affected user.\n\n---\n\n## 2. Suggested Fix\n\n### A. Fix the imports in `theme-provider.tsx`\n\nOpen `src/components/theme-provider.tsx` and ensure hooks are imported directly from React:\n\n```ts\n//  Recommended\nimport React, { useState, useEffect } from 'react';\n// or, if you prefer:\nimport * as React from 'react';\nimport { useState, useEffect } from 'react';\n```\n\nThen use them like:\n\n```ts\nexport function ThemeProvider({ children }: { children: React.ReactNode }) {\n  const [theme, setTheme] = useState<'light' | 'dark'>('light');\n\n  // ...\n  return (\n    <ThemeContext.Provider value={{ theme, setTheme }}>\n      {children}\n    </ThemeContext.Provider>\n  );\n}\n```\n\n**Avoid** patterns like:\n\n```ts\n//  Avoid this\nimport React from 'react';\nconst { useState } = React;\n\n//  Or this\nimport React from 'react';\nconst useState = React && React.useState;\n```\n\n### B. Check for custom React re-exports\n\nIf `ThemeProvider` imports from a wrapper module, e.g.:\n\n```ts\n// theme-provider.tsx\nimport { useState } from '@/lib/react'; //  potential problem\n```\n\nInspect that module (`@/lib/react`) and ensure it correctly re-exports from `'react'